import React, { useEffect } from "react";

import Alt_Coffee_icon from '../../../../../1_image_or_icon/Alt_Coffee_icon.png'

export const NearbySearch_TabResults = (props) => {


    const LineExtense = () => {
        const LineExtense = document.getElementById('LocationSearch_filter_Container')
        LineExtense.style.height = 'fit-content'
    }

    const Place_Photo_Inspector = (input) => {
        switch(typeof input.photos){
            case('object'):
            return input.photos[0].getUrl()

            case('undefined'):
            return <img
                src={Alt_Coffee_icon}
                >
            </img>
        }
    }

    const Place_Reputation_Inspector = (input) => {
        const container = []
        
        switch(typeof input.rating){
            case('undefined'):
            return <span
            style={{
                backgroundColor: 'white',
                padding: '0 2vw'
            }}
            >
                No Reputation Yet
            </span>
        
            case('number'):
            for(let i=0; i<input.rating; i++){
                container.push("\u2B50")
            }
            return container.map((star)=>{
                return <span>{star}</span>
            })

            }

    
            
        }

    useEffect(()=>{
       LineExtense()
    //    console.log(props.place)
    },[])

    return <React.Fragment>

    <div
    style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: ' 0 0 4vh 5vw',
        margin: '4vh 0'
    }}>


    {props.places.map((place)=>{
        return <div
        style={{
            width: '45vw',
            height: '30vh',
            border: 'black solid 5px',
            borderRadius: '20px',
            margin: '2vh 0',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',
            paddingBottom: '2vh'
        }}>
            <img
            src={Place_Photo_Inspector(place)}
            style={{
                width: '44vw',
                height: '15vh',
                borderRadius: '15px',
                border: 'white solid 2px',
                objectFit: 'cover'
            }}
            ></img>
            
                

                <span
                className="Places_Information_TextSection"
                style={{
                    fontSize: '5vw',
                    marginTop: '1vh'
                }}
                >
                    {place.name.split(' ').map((str)=>{
                        return <React.Fragment>
                            <span>{str}</span>
                            <br></br>
                            </React.Fragment>
                    })}
                </span>

                <span
                className="Places_Information_TextSection"
                style={{
                    position:'absolute',
                    right: '10vw',
                    paddingTop: '16vh'
                }}
                >{place.types[0]}</span>

                <span
                 className="Places_Information_TextSection"
                >
                    {Place_Reputation_Inspector(place)}
                </span>

                <span
                 className="Places_Information_TextSection"
                 style={{
                    fontSize: '3vw',
                    paddingTop: '1vh'
                 }}
                >
                    {place.vicinity}
                    
                </span>
                
                <br></br>

            

        </div>
    })}

    </div>

    </React.Fragment>

}

export default NearbySearch_TabResults;
